import React from "react";

export const BigCard = props => {
  const item = props.item;
  return item !== null ? (
    <div>
      <h1>{item.name}</h1>
      <h3>{item.username}</h3>
      <h3>{item.email}</h3>
    </div>
  ) : (
    <div className="NoSelection">
      <h1>Select a person</h1>
    </div>
  );
};
